//WRITE COMMAND

void Write_Cmd(unsigned char CMD)
{ unsigned char i;

    LCD_CS_LO;
    LCD_RS_LO;
    for(i=0;i<8;i++)
     {
    	LCD_SCL_LO;
        if(CMD&0x80) LCD_SDA_HI;
       	else LCD_SDA_LO;
       	LCD_SCL_HI;
        CMD=CMD<<1;
     }
   	LCD_CS_HI;


}

//===============================================================
//WRITE COMMAND PARAMETER

void  Write_Cmd_Data (unsigned char CMDP)
{ unsigned char i;

    LCD_CS_LO;
   	LCD_RS_HI;
    for(i=0;i<8;i++)
     {
    	LCD_SCL_LO;
        if(CMDP&0x80) LCD_SDA_HI;
       	else LCD_SDA_LO;
       	LCD_SCL_HI;
        CMDP=CMDP<<1;
     }
   	LCD_CS_HI;

}


//===================================================================
//WRITE DATA CHAR

void Write_Data(unsigned char DH,unsigned char DL)
{
	unsigned char i;

    LCD_CS_LO;
   	LCD_RS_HI;
    for(i=0;i<8;i++)
     {
    	LCD_SCL_LO;
        if(DH&0x80) LCD_SDA_HI;
       	else LCD_SDA_LO;
       	LCD_SCL_HI;
        DH=DH<<1;
     }

    for(i=0;i<8;i++)
     {  LCD_SCL_LO;
        if(DL&0x80) LCD_SDA_HI;
       	else LCD_SDA_LO;
       	LCD_SCL_HI;
        DL=DL<<1;
     }

   	LCD_CS_HI;

}



