void LCD_Enter_Sleep(void)
{
	Write_Cmd(0x28);     // Display off
	Write_Cmd(0x10);     // Enter Sleep mode
}

void LCD_Exit_Sleep(void)
{
	Write_Cmd(0x11);     // Sleep out
	vTaskDelay(100);//delay_ms(120);
	Write_Cmd(0x29);     // Display on
}


