void disp_ch(uint8_t form, uint16_t x, uint16_t y,uint8_t value,uint16_t dcolor,uint16_t bgcolor)
{
	uint16_t i,j;
	uint8_t const *temp ;//= chlibsmall;
    uint16_t cp = 0;
	uint16_t pp = 0;
	uint16_t cnum;

	if(form == FORM32X64)
	{
		temp = chlib;
		cp = 72; pp = 40;

		if(value == '-')
			temp += 10 * pp*cp/8;
		else if(value == ' ')
	  temp += 11 * pp*cp/8;
		else
			temp += (value - 48) * pp*cp/8;


	}
	else
	{
		temp = chlibsmall;
		cp = 32; pp = 24;
		temp += (value - ' ') * pp*cp/8;


	}
	LCD_SetPos(x,x+cp-1,y,y+pp-1);

	cnum = pp*cp/8 ;


	for(j=0;j<cnum;j++)
		{
		for(i=0;i<8;i++)
			{
		 	if(((*temp >> i) & 0x01)!=0)
				{
				Write_Data(dcolor>>8,dcolor);
				}
			else
				{
				Write_Data(bgcolor>>8,bgcolor);
				}
			}
		temp++;
		}
}

void disp_str(uint8_t form, uint16_t x,uint16_t y,uint8_t *str,uint16_t dcolor,uint16_t bgcolor)
{
	unsigned int x1,y1;
	x1=x;
	y1=y;
	while(*str!='\0')
	{

		disp_ch(form,x1,y1,*str,dcolor,bgcolor);
//		if(form == FORM48X120) //big form
//			x1+=47;
//		else
//			x1+=15;
#ifdef TSTAT8
		if(form == FORM32X64) //big form
			x1+=31;
		else
			x1+=23;
#elif defined TSTAT9
		if(form == FORM32X64) //big form
			y1-=31;
		else
			y1-=23;
#endif //defined TSTAT9
		str++;
	}
}


